prediction.sparql:
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath ?archiveInstitution ?archiveInstitutionLabel WHERE {
  ?person wdt:P21 wd:Q6581072 .
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  ?person wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 wd:Q3240 .
  } UNION {
    ?person wdt:P20 wd:Q3240 .
  }
  OPTIONAL {
    ?person wdt:P485 ?archiveInstitution .
    OPTIONAL {
      ?archiveInstitution rdfs:label ?archiveInstitutionLabel FILTER ( LANG( ?archiveInstitutionLabel ) = "en" )
    }
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?person ?netWorth ?personLabel WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P2218 ?netWorth .
  FILTER ( ?netWorth >= 1000000000 ) OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
}
ORDER BY DESC ( ?netWorth )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numUnmarriedPartners ( COUNT( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?numFemales ) ( COUNT( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?numMales ) WHERE {
  VALUES ?occupation {
    wd:Q108289408 wd:Q100951393 wd:Q108290379 wd:Q108290380 wd:Q108290381 wd:Q15855449 wd:Q177220 wd:Q3391743 wd:Q33999
  }
  ?person wdt:P106 ?occupation .
  ?person wdt:P21 ?gender .
  FILTER ( ?gender IN ( wd:Q6581072 , wd:Q6581097 ) ) OPTIONAL {
    ?person wdt:P451 ?partner .
  }
  {
    SELECT ?person ( COUNT( ?partner ) AS ?numUnmarriedPartners ) WHERE {
      OPTIONAL {
        ?person wdt:P451 ?partner .
      }
    }
    GROUP BY ?person
  }
}
GROUP BY ?numUnmarriedPartners
ORDER BY ?numUnmarriedPartners

