PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?mountain ?elevation ?body ?mountainLabel WHERE {
  ?mountain wdt:P31 wd:Q8502 .
  ?mountain wdt:P2044 ?elevation .
  FILTER ( ?elevation > 8000 ) OPTIONAL {
    ?mountain wdt:P376 ?body
  }
  FILTER ( ! BOUND( ?body ) || ?body = wd:Q2 ) OPTIONAL {
    ?mountain rdfs:label ?mountainLabel FILTER ( LANG( ?mountainLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?event ?eventLabel ?tournament ?tournamentLabel WHERE {
  ?event wdt:P31 wd:Q46190676 ; wdt:P2094 wd:Q16893072 ; wdt:P361 ?tournament .
  FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  ?tournament ( wdt:P361 * ) ?series .
  FILTER ( ?series = wd:Q300008 || ?series = wd:Q3775082 ) OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( lang( ?eventLabel ) = "en" )
  }
  OPTIONAL {
    ?tournament rdfs:label ?tournamentLabel FILTER ( lang( ?tournamentLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?person ?dateOfDeath ?fsid ?father ?personLabel ?fatherLabel WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P27 wd:Q16 ; wdt:P570 ?dateOfDeath ; wdt:P2889 ?fsid ; wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFsid
  }
  OPTIONAL {
