PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?category ?categoryLabel_fr ( SUM( ?count ) AS ?total ) WHERE {
  {
    SELECT ( IF( ?count > 499 , STR( ?legalForm ) , "OTHER" ) AS ?category ) ( IF( ?count > 499 , ?legalFormLabel_fr , "AUTRE" ) AS ?categoryLabel_fr ) ?count WHERE {
      {
        SELECT ?legalForm ( COUNT( ?org ) AS ?count ) WHERE {
          ?org wdt:P31 wd:Q43229 ; wdt:P17 wd:Q142 ; wdt:P1454 ?legalForm .
          ?legalForm wdt:P279 | wdt:P31 wd:Q56427813 .
        }
        GROUP BY ?legalForm
      }
      OPTIONAL {
        ?legalForm rdfs:label ?legalFormLabel_fr .
        FILTER ( LANG( ?legalFormLabel_fr ) = 'fr' )
      }
    }
  }
}
GROUP BY ?category ?categoryLabel_fr
ORDER BY DESC ( ?total )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
SELECT ?settlement ?coord ?distance ?centerCoord WHERE {
  VALUES ?type {
    wd:Q532 wd:Q3957
  }
  ?settlement wdt:P31 ?type ; wdt:P17 wd:Q213 ; wdt:P625 ?coord .
  BIND( "Point(14.644975 49.534590)" ^^ geo:wktLiteral AS ?centerCoord ) BIND( geof:distance ( ?coord , ?centerCoord ) AS ?distance ) FILTER ( ?distance <= 35 )
}
ORDER BY ?distance

