PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?capital ?currency ?population ?flag ?determinationMethod WHERE {
  ?country wdt:P31 wd:Q3624078 .
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q3024240 .
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q28171280 .
  }
  OPTIONAL {
    ?country wdt:P36 ?capital .
  }
  OPTIONAL {
    ?country wdt:P38 ?currency .
  }
  OPTIONAL {
    ?country wdt:P1082 ?population .
  }
  OPTIONAL {
    ?country wdt:P41 ?flag .
  }
  OPTIONAL {
    ?country p:P36 ?capitalStatement .
    ?capitalStatement ps:P36 ?capital .
    OPTIONAL {
      ?capitalStatement pq:P459 ?determinationMethod .
    }
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?country ?flag ?population ?countryLabel WHERE {
  ?country wdt:P31 wd:Q6256 .
  ?country wdt:P41 ?flag .
  ?country wdt:P1082 ?population .
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( lang( ?countryLabel ) = "en" )
