PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?author ?authorLabel ?birthplace ?birthplaceLabel ?dob WHERE {
  ?author wdt:P106 wd:Q482980 ; wdt:P27 wd:Q30 ; wdt:P19 ?birthplace ; wdt:P569 ?dob .
  FILTER ( ?dob > "1919-12-31" ^^ xsd:date ) FILTER NOT EXISTS {
    ?author wdt:P570 ?dod
  }
  ?birthplace wdt:P131 * wd:Q771 .
  OPTIONAL {
    ?author rdfs:label ?authorLabel FILTER ( LANG( ?authorLabel ) = "en" )
  }
  OPTIONAL {
    ?birthplace rdfs:label ?birthplaceLabel FILTER ( LANG( ?birthplaceLabel ) = "en" )
  }
}
ORDER BY ?dob

PREFIX wd: <http://www.wikidata.org/entity/>
