  VALUES ?party {
    wd:Q85843184 wd:Q15630787
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item ?officialWebsite WHERE {
  ?item wdt:P856 ?officialWebsite .
  FILTER ( CONTAINS( LCASE( STR( ?officialWebsite ) ) , "twitter" ) )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?state ?stateLabel ?population ( COUNT( ?otherState ) + 1 AS ?populationRank ) WHERE {
  wd:Q458 wdt:P150 ?state .
  OPTIONAL {
    ?state wdt:P1082 ?population .
  }
  OPTIONAL {
    ?state rdfs:label ?stateLabel FILTER ( LANG( ?stateLabel ) = "en" )
  }
  OPTIONAL {
    wd:Q458 wdt:P150 ?otherState .
    ?otherState wdt:P1082 ?otherPopulation .
    ?state wdt:P1082 ?population .
    FILTER ( ?otherPopulation > ?population )
  }
}
GROUP BY ?state ?stateLabel ?population
ORDER BY ?populationRank

PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?company ?companyLabel ?revenue ?revenueUnitLabel ?revenueDate ?netProfit ?profitMargin ?hq ?hqLabel WHERE {
  ?company wdt:P31 / wdt:P279 * wd:Q4830453 ; wdt:P159 ?hq .
  ?hq ( wdt:P17 | wdt:P131 * ) wd:Q213 .
  FILTER ( ?company != wd:Q100707321 && ?company != wd:Q12021780 ) OPTIONAL {
    ?company p:P2139 ?revenueStatement .
    ?revenueStatement ps:P2139 ?revenue .
    OPTIONAL {
      ?revenueStatement pq:P8111 ?revenueUnit .
      ?revenueUnit rdfs:label ?revenueUnitLabel
      FILTER ( LANG( ?revenueUnitLabel ) = "en" )
    }
