SELECT ?municipality ?municipalityLabel ?pop_recent ?year_recent ?pop_10y ?year_10y WHERE {
  {
    SELECT ?municipality ( MAX( ?year ) AS ?year_recent ) WHERE {
      ?municipality wdt:P31 wd:Q2074737 ; wdt:P131 wd:Q93366 .
      ?municipality p:P1082 ?popStatement .
      ?popStatement pq:P585 ?date .
      BIND( YEAR( ?date ) AS ?year )
    }
    GROUP BY ?municipality
  }
  ?municipality p:P1082 ?popStatementRecent .
  ?popStatementRecent pq:P585 ?date_recent ; ps:P1082 ?pop_recent .
  BIND( YEAR( ?date_recent ) AS ?year_recent_check ) FILTER ( ?year_recent_check = ?year_recent ) OPTIONAL {
    {
      SELECT ?municipality ( MIN( ABS( ?year_10y - ( ?year_recent - 10 ) ) ) AS ?minDiff ) WHERE {
        ?municipality p:P1082 ?popStatement10 .
        ?popStatement10 pq:P585 ?date_10y .
        BIND( YEAR( ?date_10y ) AS ?year_10y ) {
          SELECT ?municipality ( MAX( ?year ) AS ?year_recent ) WHERE {
            ?municipality wdt:P31 wd:Q2074737 ; wdt:P131 wd:Q93366 .
            ?municipality p:P1082 ?popStatement .
            ?popStatement pq:P585 ?date .
            BIND( YEAR( ?date ) AS ?year )
          }
          GROUP BY ?municipality
        }
      }
      GROUP BY ?municipality
    }
    ?municipality p:P1082 ?popStatement10 .
    ?popStatement10 pq:P585 ?date_10y ; ps:P1082 ?pop_10y .
    BIND( YEAR( ?date_10y ) AS ?year_10y ) FILTER ( ABS( ?year_10y - ( ?year_recent - 10 ) ) = ?minDiff )
  }
  OPTIONAL {
    ?municipality rdfs:label ?municipalityLabel FILTER ( LANG( ?municipalityLabel ) = "en" )
  }
}

