  ?settlement p:P1448 ?nameStatement .
  ?nameStatement ps:P1448 ?nameWithLang .
  BIND( ?nameWithLang AS ?name ) BIND( LANG( ?nameWithLang ) AS ?lang ) OPTIONAL {
    ?nameStatement pq:P580 ?start
  }
  OPTIONAL {
    ?nameStatement pq:P585 ?point
  }
  OPTIONAL {
    ?nameStatement pq:P582 ?end
  }
}

