SELECT ?commune ?name ?lat ?lon ?coord_source WHERE {
  ?commune wdt:P31 wd:Q747074 .
  OPTIONAL {
    ?commune wdt:P1332 ?northernmost .
    ?northernmost wikibase:geoLatitude ?lat ; wikibase:geoLongitude ?lon .
    BIND( "northernmost" AS ?coord_source )
  }
  OPTIONAL {
    ?commune wdt:P625 ?maincoord .
    ?maincoord wikibase:geoLatitude ?lat2 ; wikibase:geoLongitude ?lon2 .
    FILTER ( ! BOUND( ?lat ) ) BIND( ?lat2 AS ?lat ) BIND( ?lon2 AS ?lon ) BIND( "main" AS ?coord_source )
  }
  FILTER ( ?lat > 45.606795 ) OPTIONAL {
    ?commune rdfs:label ?name .
    FILTER ( LANG( ?name ) = "en" || LANG( ?name ) = "it" )
  }
}
ORDER BY DESC ( ?lat )

PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?war ?warLabel ?start ?end ?durationDays WHERE {
  ?war wdt:P31 wd:Q198 ; wdt:P580 ?start ; wdt:P582 ?end .
  OPTIONAL {
    ?war wdt:P2047 ?duration .
    OPTIONAL {
      ?war p:P2047 / psv:P2047 / wikibase:quantityUnit ?unit
    }
    BIND( IF( ?unit = wd:Q7727 , xsd:decimal ( ?duration ) / 1440 , IF( ?unit = wd:Q5151 , xsd:decimal ( ?duration ) * 30.44 , IF( ?unit = wd:Q25235 , xsd:decimal ( ?duration ) / 86400 , IF( ?unit = wd:Q11574 , xsd:decimal ( ?duration ) / 24 , IF( ?unit = wd:Q573 , xsd:decimal ( ?duration ) * 365.25 , IF( ?unit = wd:Q577 , xsd:decimal ( ?duration ) * 365.25 , IF( ! BOUND( ?unit ) , xsd:decimal ( ?duration ) , -1 ) ) ) ) ) ) ) AS ?durationDays )
  }
  BIND( IF( ! BOUND( ?durationDays ) && STR( ?start ) = STR( ?end ) , 0 , ?durationDays ) AS ?durationDaysFinal ) OPTIONAL {
    ?war rdfs:label ?warLabel FILTER ( LANG( ?warLabel ) = "en" )
  }
  FILTER ( BOUND( ?durationDaysFinal ) && ?durationDaysFinal >= 0 )
}
ORDER BY ?durationDaysFinal ?start
LIMIT 15

