SELECT ?otherAward ?otherAwardLabel
       (COUNT(DISTINCT ?person) AS ?totalRecipients)
       (COUNT(DISTINCT ?person_before) AS ?beforeCount)
       (COUNT(DISTINCT ?person_after) AS ?afterCount)
       (COUNT(DISTINCT ?person_same) AS ?sameCount)
       (COUNT(DISTINCT ?person_unknown) AS ?unknownCount)
WHERE {
  {
    SELECT DISTINCT ?person ?otherAward ?timing WHERE {
      # Leibniz Prize winners
      ?person wdt:P166 wd:Q703205 ; wdt:P31 wd:Q5 .
      ?person p:P166 ?leibnizAwardStatement .
      ?leibnizAwardStatement ps:P166 wd:Q703205 .
      OPTIONAL { ?leibnizAwardStatement pq:P585 ?leibnizDate . }
      # Other awards
      ?person p:P166 ?otherAwardStatement .
      ?otherAwardStatement ps:P166 ?otherAward .
      FILTER(?otherAward != wd:Q703205)
      # Award type filtering
      {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q11448906 . # science award
      } UNION {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q15383322 . # cultural prize
      } UNION {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q107471279 . # chemistry award
      } UNION {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q378427 . # literary award
      } UNION {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q107494520 . # physics award
      } UNION {
        ?otherAward (wdt:P31/wdt:P279*) wd:Q1709894 . # journalism prize
      } UNION {
        ?otherAward wdt:P31/wdt:P279* wd:Q618779 ;
                    wdt:P1027 ?academy .
        ?academy wdt:P31/wdt:P279* wd:Q1966910 .
      }
      # Only true awards
      ?otherAward (wdt:P31/wdt:P279*) wd:Q618779 .
      OPTIONAL { ?otherAwardStatement pq:P585 ?otherAwardDate . }
      BIND(
        IF(BOUND(?otherAwardDate) && BOUND(?leibnizDate),
          IF(?otherAwardDate < ?leibnizDate, "before",
            IF(?otherAwardDate > ?leibnizDate, "after",
              IF(?otherAwardDate = ?leibnizDate, "same", "unknown"))),
          "unknown") AS ?timing
      )
    }
  }
  # For each (person, award, timing), count only once
  BIND(IF(?timing = "before", ?person, UNDEF) AS ?person_before)
  BIND(IF(?timing = "after", ?person, UNDEF) AS ?person_after)
  BIND(IF(?timing = "same", ?person, UNDEF) AS ?person_same)
  BIND(IF(?timing = "unknown", ?person, UNDEF) AS ?person_unknown)
  OPTIONAL { ?otherAward rdfs:label ?otherAwardLabel FILTER (lang(?otherAwardLabel) = "en") }
}
GROUP BY ?otherAward ?otherAwardLabel
ORDER BY DESC(?totalRecipients)

