PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?voiceType ?voiceTypeLabel WHERE {
  ?person wdt:P412 ?voiceType .
  ?person wdt:P31 wd:Q5 .
  FILTER ( ?voiceType IN ( wd:Q30903 , wd:Q186506 , wd:Q37137 , wd:Q223166 , wd:Q27914 , wd:Q31687 , wd:Q27911 , wd:Q58192 , wd:Q359282 , wd:Q8243257 , wd:Q810480 , wd:Q2532487 , wd:Q2338646 , wd:Q1999862 , wd:Q6141663 ) ) FILTER NOT EXISTS {
    ?person wdt:P106 ?occupation
  }
  OPTIONAL {
    ?voiceType rdfs:label ?voiceTypeLabel FILTER ( LANG( ?voiceTypeLabel ) = "en" )
  }
}
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?municipality ?municipalityLabel ?idescat_code ( MAX( ?popValue ) AS ?population ) ( MAX( ?popDate ) AS ?population_date ) ?area ?coat_of_arms WHERE {
  ?municipality wdt:P4335 ?idescat_code ; wdt:P31 wd:Q33146843 .
  FILTER ( STRSTARTS( ?idescat_code , "25" ) ) OPTIONAL {
    ?municipality rdfs:label ?municipalityLabel .
    FILTER ( LANG( ?municipalityLabel ) = "en" )
  }
  OPTIONAL {
    ?municipality wdt:P2046 ?area .
  }
  OPTIONAL {
    ?municipality wdt:P94 ?coat_of_arms .
  }
  OPTIONAL {
    ?municipality p:P1082 ?popStatement .
    ?popStatement ps:P1082 ?popValue .
    OPTIONAL {
      ?popStatement pq:P585 ?popDate .
    }
    OPTIONAL {
      ?popStatement wikibase:rank ?popRank .
    }
    BIND( IF( BOUND( ?popRank ) && ?popRank = wikibase:PreferredRank , 1 , 0 ) AS ?isPreferred )
  }
}
GROUP BY ?municipality ?municipalityLabel ?idescat_code ?area ?coat_of_arms

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?item WHERE {
  ?item rdfs:label "Madonna and Child" @en .
  FILTER NOT EXISTS {
    ?item rdfs:label ?frLabel .
    FILTER ( LANG( ?frLabel ) = "fr" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?library ?libraryLabel ?parent ?parentLabel ?branch ?branchLabel WHERE {
  ?library wdt:P361 wd:Q30268112 .
  ?library wdt:P361 ?parent .
  OPTIONAL {
    ?library rdfs:label ?libraryLabel FILTER ( lang( ?libraryLabel ) = "en" )
  }
  OPTIONAL {
    ?parent rdfs:label ?parentLabel FILTER ( lang( ?parentLabel ) = "en" )
  }
  OPTIONAL {
    ?library wdt:P527 ?branch .
    OPTIONAL {
      ?branch rdfs:label ?branchLabel FILTER ( lang( ?branchLabel ) = "en" )
    }
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ( COUNT( ?airport ) AS ?airportCount ) ?population WHERE {
  ?airport wdt:P31 wd:Q1248784 ; wdt:P17 ?country .
  FILTER NOT EXISTS {
    ?airport wdt:P582 ?endtime
  }
  FILTER NOT EXISTS {
    ?airport wdt:P576 ?dissolved
  }
  OPTIONAL {
    ?country wdt:P1082 ?population
  }
}
GROUP BY ?country ?population

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?person ?personLabel ?start ?district ?districtLabel ?election ?electionLabel WHERE {
  ?person p:P39 ?statement .
  ?statement ps:P39 wd:Q29169698 .
  ?statement pq:P580 ?start .
  OPTIONAL {
    ?statement pq:P768 ?district .
    OPTIONAL {
      ?district rdfs:label ?districtLabel FILTER ( LANG( ?districtLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?statement pq:P2715 ?election .
    OPTIONAL {
      ?election rdfs:label ?electionLabel FILTER ( LANG( ?electionLabel ) = "en" )
    }
  }
  FILTER NOT EXISTS {
    ?statement pq:P582 ?end
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
}
ORDER BY ?person

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?event ?eventLabel ?year ?country WHERE {
  ?event wdt:P1346 wd:Q182736 .
  ?event wdt:P31 ?eventType .
  ?eventType wdt:P279 * ?supertype .
  FILTER ( ?supertype IN ( wd:Q13219666 , wd:Q47459169 ) ) OPTIONAL {
    ?event wdt:P585 ?year .
  }
  OPTIONAL {
    ?event wdt:P17 ?country .
  }
  OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( LANG( ?eventLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?candidate ?candidateLabel WHERE {
  VALUES ?election {
    wd:Q93307086 wd:Q93307088 wd:Q93307085 wd:Q93307089 wd:Q96279006
  }
  ?election wdt:P726 ?candidate .
  OPTIONAL {
    ?candidate rdfs:label ?candidateLabel FILTER ( lang( ?candidateLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX schema: <http://schema.org/>
SELECT ?prop ( SAMPLE( ?propLabel ) AS ?label ) ( COUNT( DISTINCT ?item ) AS ?count ) ( 100.0 * COUNT( DISTINCT ?item ) / ?total AS ?percentage ) WHERE {
  {
    SELECT ( COUNT( DISTINCT ?item ) AS ?total ) WHERE {
      ?article schema:isPartOf <https://ary.wikipedia.org/> .
      ?article schema:about ?item .
      ?item wdt:P31 wd:Q5398426 .
    }
  }
  ?article schema:isPartOf <https://ary.wikipedia.org/> .
  ?article schema:about ?item .
  ?item wdt:P31 wd:Q5398426 .
  ?item ?p ?value .
  FILTER ( STRSTARTS( STR( ?p ) , "http://www.wikidata.org/prop/direct/" ) ) BIND( IRI( REPLACE( STR( ?p ) , "http://www.wikidata.org/prop/direct/" , "http://www.wikidata.org/entity/" ) ) AS ?prop ) FILTER NOT EXISTS {
    ?prop wikibase:propertyType wikibase:ExternalId
  }
  OPTIONAL {
    ?prop rdfs:label ?propLabel FILTER ( LANG( ?propLabel ) = "en" )
  }
}
GROUP BY ?prop ?total
ORDER BY DESC ( ?count )
LIMIT 20

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?coaster ?country WHERE {
  ?coaster wdt:P31 wd:Q204832 .
  OPTIONAL {
    ?coaster wdt:P17 ?country .
  }
}
LIMIT 50

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?erratum ?erratumLabel ?item ?itemLabel ?trimmedLabel WHERE {
  ?erratum rdfs:label ?erratumLabel .
  FILTER ( LANG( ?erratumLabel ) = 'en' ) FILTER STRSTARTS( ?erratumLabel , "Erratum:" ) ?erratum wdt:P2507 ?item .
  ?item rdfs:label ?itemLabel .
  FILTER ( LANG( ?itemLabel ) = 'en' ) FILTER NOT EXISTS {
    ?x wdt:P2507 ?erratum
  }
  BIND( SUBSTR( ?erratumLabel , 10 ) AS ?trimmedLabel ) FILTER ( STRLEN( ?trimmedLabel ) > 20 )
}
LIMIT 20

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?city ?label ?coord WHERE {
  ?city wdt:P625 ?coord .
  ?city rdfs:label ?label .
  FILTER ( LANG( ?label ) = "en" ) FILTER ( STRENDS( ?label , "pol" ) ) ?city wdt:P31 ?type .
  FILTER ( ?type IN ( wd:Q515 , wd:Q3957 ) ) {
    ?city wdt:P17 wd:Q159 .
  } UNION {
    ?city wdt:P131 wd:Q159 .
  }
}
